    module Token = struct
        module T = struct
            type t =
              | EPSILON (* "ε" *)
              | PSEUDO_END (* "⊥" *)
              | HOCC of token_hocc (* "hocc" *)
              | NONTERM of token_nonterm (* "nonterm" *)
              | EPSILON_ of token_epsilon (* "epsilon" *)
              | START of token_start (* "start" *)
              | TOKEN of token_token (* "token" *)
              | NEUTRAL of token_neutral (* "neutral" *)
              | LEFT of token_left (* "left" *)
              | RIGHT of token_right (* "right" *)
              | NONASSOC of token_nonassoc (* "nonassoc" *)
              | PREC of token_prec (* "prec" *)
              | UIDENT of token_uident
              | CIDENT of token_cident
              | USCORE of token_uscore (* "_" *)
              | ISTRING of token_istring
              | COLON_COLON_EQ of token_colon_colon_eq (* "::=" *)
              | OF of token_of (* "of" *)
              | COLON of token_colon (* ":" *)
              | DOT of token_dot (* "." *)
              | ARROW of token_arrow (* "->" *)
              | BAR of token_bar (* "|" *)
              | LT of token_lt (* "<" *)
              | EQ of token_eq (* "=" *)
              | COMMA of token_comma (* "," *)
              | SEMI of token_semi (* ";" *)
              | AS of token_as (* "as" *)
              | LINE_DELIM of token_line_delim
              | INDENT of token_indent
              | DEDENT of token_dedent
              | LPAREN of token_lparen (* "(" *)
              | RPAREN of token_rparen (* ")" *)
              | LCAPTURE of token_lcapture (* "(|" *)
              | RCAPTURE of token_rcapture (* "|)" *)
              | LBRACK of token_lbrack (* "[" *)
              | RBRACK of token_rbrack (* "]" *)
              | LARRAY of token_larray (* "[|" *)
              | RARRAY of token_rarray (* "|]" *)
              | LCURLY of token_lcurly (* "{" *)
              | RCURLY of token_rcurly (* "}" *)
              | OTHER_TOKEN of token_other_token
              | EOI of token_eoi

            let index = function
              | EPSILON -> 0L
              | PSEUDO_END -> 1L
              | HOCC _ -> 2L
              | NONTERM _ -> 3L
              | EPSILON_ _ -> 4L
              | START _ -> 5L
              | TOKEN _ -> 6L
              | NEUTRAL _ -> 7L
              | LEFT _ -> 8L
              | RIGHT _ -> 9L
              | NONASSOC _ -> 10L
              | PREC _ -> 11L
              | UIDENT _ -> 12L
              | CIDENT _ -> 13L
              | USCORE _ -> 14L
              | ISTRING _ -> 15L
              | COLON_COLON_EQ _ -> 16L
              | OF _ -> 17L
              | COLON _ -> 18L
              | DOT _ -> 19L
              | ARROW _ -> 20L
              | BAR _ -> 21L
              | LT _ -> 22L
              | EQ _ -> 23L
              | COMMA _ -> 24L
              | SEMI _ -> 25L
              | AS _ -> 26L
              | LINE_DELIM _ -> 27L
              | INDENT _ -> 28L
              | DEDENT _ -> 29L
              | LPAREN _ -> 30L
              | RPAREN _ -> 31L
              | LCAPTURE _ -> 32L
              | RCAPTURE _ -> 33L
              | LBRACK _ -> 34L
              | RBRACK _ -> 35L
              | LARRAY _ -> 36L
              | RARRAY _ -> 37L
              | LCURLY _ -> 38L
              | RCURLY _ -> 39L
              | OTHER_TOKEN _ -> 40L
              | EOI _ -> 41L

            let hash_fold t state =
                state |> Uns.hash_fold (index t)

            let cmp t0 t1 =
                Uns.cmp (index t0) (index t1)

            let spec t =
                Array.get (index t) Spec.symbols

            let pp t formatter =
                formatter
                  |> Spec.Symbol.pp (spec t)
          end
        include T
        include Identifiable.Make(T)
      end

